webpackJsonp([74228480928951],{507:function(e,t){e.exports={data:{site:{siteMetadata:{title:"5π - fish's blog",author:"Johannes 'fish' Ziemke"}},markdownRemark:{id:"/usr/src/src/pages/2015/10/02/the-future/index.md absPath of file >>> MarkdownRemark",html:"<p>Since I was a kid, I was fascinated with sci-fi and today I’m thrilled to live\nin the unique age of unprecedenced velocity of invention.</p>\n<p>A few years ago, Elon Musk’s idea of building an electric car that can compete\nwith regular cars was a moonshot. It was close to impossible, yet he succeeded.</p>\n<p>From todays perspective, this seems like a nobrainer. I found myself recently\nthinking: “Boohh, cars for individual transportation is to 1900”. Soon, you\nwon’t buy cars anymore. (Sure, that’s something Tesla knows as well and they are\nstill in a good position).</p>\n<p>Beside being incrediably fascinating, this velocity has another advantage: You\ncan think crazy sci-fi and see just a few years later how close you got. So I\nthought I start blogging about a few crazy ideas. Maybe someone even finds\nthemself inspired by those.</p>",frontmatter:{title:"The Future",date:"2015-10-02 10:57:53 +0000"}}},pathContext:{slug:"/2015/10/02/the-future/",previous:{fields:{slug:"/2015/09/02/uploaded-thousands-of-photos-to-google-photos-here-are-the-best-classification-mistakes/"},frontmatter:{title:"Uploaded thousands of Photos to Google Photos, here are the best classification mistakes"}},next:{fields:{slug:"/2015/10/05/the-future-fabrication-cloud/"},frontmatter:{title:"The Future: Fabrication Cloud"}}}}}});
